Information
------------------------------

Which Universe Are We In?
The most dangerous idea in science might turn out to be true: we live in a multiverse of truly infinite proportions. The universe we live in may not be the only one out there. In fact, our universe could be just one of an infinite number of universes making up a &quot;multiverse
The first 'hard evidence' that other universes exist has been found by scientists.
Cosmologists studying a map of the universe from data gathered by the Planck spacecraft have concluded that it shows anomalies that can only have been caused by the gravitational pull of other universes.
The map shows radiation from the Big Bang 13.8billion years ago that is still detectable in the universe - known as cosmic microwave radiation. Scientists had predicted that it should be evenly distributed, but the map shows a stronger concentration in the south half of the sky and a 'cold spot' that cannot be explained by current understanding of physics.
Laura Mersini-Houghton, theoretical physicist at the University of North Carolina at Chapel Hill, and Richard Holman, professor at Carnegie Mellon University, predicted that anomalies in radiation existed and were caused by the pull from other universes in 2005.

